==English==
===Noun===
{{en-noun}}
# {{lb|en|nautical}} A [[headsail]] resembling a [[genoa]] or a [[jib]] but with a high-cut [[clew]], normally used together with a [[staysail]]. A sailing boat is typically equipped with three yankee sails of different sizes, number one being the largest.
